package com.huiger.screenshotdemo;

import android.app.AlertDialog;
import android.content.Context;
import android.content.DialogInterface;
import android.os.Build;
import android.os.Bundle;
import android.support.annotation.Nullable;
import android.support.v7.app.AppCompatActivity;
import android.view.View;
import android.webkit.JavascriptInterface;
import android.webkit.JsResult;
import android.webkit.ValueCallback;
import android.webkit.WebChromeClient;
import android.webkit.WebResourceError;
import android.webkit.WebResourceRequest;
import android.webkit.WebSettings;
import android.webkit.WebView;
import android.webkit.WebViewClient;
import android.widget.Button;

public class MainActivity extends AppCompatActivity {

  private String bitstring =
      "";
  private String a =
      "";
  private String string =
      "";

  private Button jscall;
  private WebView mWebView;

  @Override
  protected void onCreate(@Nullable Bundle savedInstanceState) {
    super.onCreate(savedInstanceState);
    setContentView(R.layout.activity_main);
    mWebView = findViewById(R.id.webview);
    jscall = findViewById(R.id.jscall);

    WebSettings webSettings = mWebView.getSettings();
    // 设置与Js交互的权限
    webSettings.setJavaScriptEnabled(true);
    // 设置允许JS弹窗
    webSettings.setJavaScriptCanOpenWindowsAutomatically(true);

    // JS调用android
    mWebView.addJavascriptInterface(new JavaScriptinterface(this), "android");

    // 先载入JS代码
    // 格式规定为:file:///android_asset/文件名.html
    mWebView.loadUrl("file:///android_asset/javascript.html");

    jscall.setOnClickListener(
        new View.OnClickListener() {
          @Override
          public void onClick(View v) {
            StringBuilder stringIO = new StringBuilder();
            for (int i = 0; i < 300; i++) {
              stringIO.append(bitstring).append(a).append(string);
            }

            System.out.println("stringIO.length==" + stringIO.length());
              if (Build.VERSION.SDK_INT >= Build.VERSION_CODES.KITKAT) {
                  mWebView.evaluateJavascript("javascript:callJS('" + stringIO + "')", new ValueCallback<String>() {
                      @Override
                      public void onReceiveValue(String value) {
                          System.out.println("value==" + value);
                      }
                  });
              }
          }
        });
      mWebView.setWebViewClient(new WebViewClient(){
          @Override
          public void onReceivedError(WebView view, WebResourceRequest request, WebResourceError error) {
              super.onReceivedError(view, request, error);
          }

      });

    mWebView.setWebChromeClient(
        new WebChromeClient() {
          @Override
          public boolean onJsAlert(
              WebView view, String url, String message, final JsResult result) {
            AlertDialog.Builder b = new AlertDialog.Builder(MainActivity.this);
            b.setTitle("Alert");
            b.setMessage(message);
            b.setPositiveButton(
                android.R.string.ok,
                new DialogInterface.OnClickListener() {
                  @Override
                  public void onClick(DialogInterface dialog, int which) {
                    result.confirm();
                  }
                });
            b.setCancelable(false);
            b.create().show();
            return true;
          }
        });
  }

  class JavaScriptinterface {
    Context context;

    private JavaScriptinterface(Context c) {
      context = c;
    }

    /** 与js交互时用到的方法，在js里直接调用的 */
    @JavascriptInterface
    public void print(String ssss) {
      System.out.println("JS调用了Android的hello方法" + ssss);
    }
  }
}
